}
</code></pre>

<p>I wrote a api call that when a user lands on their account page, it finds the user and returns their prize entires (array of prizes). I then want to use these to query the DB to find the title/content of each entry so it can be displayed on the front end.</p>

<p>I've done this two ways</p>

<pre><code>var prizes = user.prizes

       //mongo

       ids = prizes.map(function(el) { return mongoose.Types.ObjectId(el) })

       Prize.aggregate([
        { $match: { "_id": { "$in": ids } } }

      ], function(err, ret){
        if (err) {
            return res.status(500).json({
                title: 'An error occurred',
                error: err
            });

        }
          console.log(ret)
      }
    )
</code></pre>

<p>or </p>

<pre><code>Prize.find( { _id: prizes }, { title: 1, content: 1 }, function(err, ret){
        if (err) {
            return res.status(500).json({
                title: 'An error occurred',
                error: err
            });

        }
console.log(ret)



       })
</code></pre>

<p>Now the difficult part, both of these operations only return unique documents, (2) and not the 6 I wanted.</p>

<p>I wanted to find for every entry id then return that prize id's title and content , without caring if unique or not or have a count in response, so giving my user above it would return</p>

<p>{1x unique doc  count 4}
{1x unique doc, count 1}</p>

<p>or return 6 responses. </p>

<p>Even when I used the .count(), it only counted 2. I know I must be going about this the wrong way, as mongo is correct in that i'm asking it to find the documents matching the id's I pass it and it finds the 2 matching id's and serves them up. </p>

<p>Am i almost breaking it's functionality by asking it to do something different? Other options? Wrap it up in a for each in node and query each id manually and push to an array?</p>

