Limit MongoDB aggregation $lookup to only 1 match<p>There are two collections, <code>users</code> and <code>reports</code>.</p>

<p>My goal is to make an aggregation that gets all users and for each <code>user</code> includes the amount of user's <strong>last</strong> <code>report</code>.</p>

<p>Here is my current aggregation:</p>

<pre><code>db.users.aggregate([{
  $lookup: {
    from: 'reports',
    localField: '_id',
    foreignField: 'userId',
    as: 'report',
  },
}, {
  $project: {
    'lastReportAmount': {
      $let: {
        vars: {
          lastReport: {'$arrayElemAt': ['$report', 0]},
        },
        in: '$$lastReport.amount',
      },
    },
    'id': '$_id',
    'name': 1,
    'firstLogin': 1,
    'email': 1,
  },
}])
</code></pre>

<p>This query works correctly, BUT it's very slow.<br>
The reason for that is that <code>$lookup</code> returns <strong>all</strong> reports that match a certain <code>userId</code>, instead of one (last).</p>

<p><strong>Is there a way to limit the <code>$lookup</code> to only one match?</strong></p>

