Syntax for chaining mongoose promises<p>I am relatively new to using Promises and MongoDB / Mongoose, and am trying to chain a flow through several database queries into an efficient and reliable function.</p>

<p>I want to know if my final function is a good and reliable way of achieving what I want, or if there are any issues or any improvements that can be made.</p>

<p>The process is as follows:</p>

<p>1) Check whether or not the user already exists</p>

<pre><code>usersSchema.findOne({
    email: email
}).then(res =&gt; {
    if(res==null){
        // user does not exist
    }
}).catch(err =&gt; {});
</code></pre>

<p>2) Add the new user to the database</p>

<pre><code>var new_user = new usersSchema({ email: email });
new_user.save().then(res =&gt; {
    // new user id is res._id
}).catch(err =&gt; {});
</code></pre>

<p>3) Assign a free promotional code to the user</p>

<pre><code>codeSchema.findOneAndUpdate({
    used: false,
    user_id: true
},{
    used: true,
    user_id: mongoose.Types.ObjectId(res._id)
}).then(res =&gt; {
    // user's code is res.code
}).catch(err =&gt; {});
</code></pre>

<p>Obviously, each query needs to execute in sequence, so after a lot of research and experimentation into how to do this I have combined the queries into the following function, which seems to be working fine so far:</p>

<pre><code>function signup(email){
    // check email isn't already signed up
    return usersSchema.findOne({
        email: email
    }).then(res =&gt; {
        if(res==null){
            // add to schema
            var new_user = new usersSchema({ email: email });
            // insert new user
            return new_user.save().then(res =&gt; {
                var result = parse_result(res);
                // assign a code
                return codesSchema.findOneAndUpdate({
                    used: false,
                    user_id: true
                },{
                    used: true,
                    user_id: mongoose.Types.ObjectId(result._id),
                });
            });
        }else{
            return 'The user already exists';
        }
    });
}

signup('test@test.com').then(res =&gt; {
    console.log('success, your code is '+res.code);
}).catch(err =&gt; {
    console.log(err);
});
</code></pre>

<p>I'm still trying to get my head around exactly how and why this works - the function is returning a promise, and each nested promise is returning a promise.</p>

<p>My main concerns are that there is a lot of nesting going on (is there perhaps a way to do this by chaining .then() callbacks instead of nesting everything?) and that the nested promises don't appear to have error catching, although as the signup() function itself is a promise this seems to catch all the errors.</p>

<p>Is anyone knowledgeable on the subject able to confirm whether my process looks good and reliable or not? Thanks!</p>

